import React from "react";
import { Header } from "../../components/header";
import {
  Column,
  Container,
  Text,
  TitleHighLight,
  TitlePrincipal,
  Wrapper,
} from "./styles";
import Button from "../../components/button";
import { Input } from "../../components/Input/Input";

const Login = () => {
  return (
    <>
      <Header />
      <Container>
        <Column>
          <TitlePrincipal>
            Chegou a <span/>
            <TitleHighLight>
              Hora <br />
            </TitleHighLight>
            de se transformar em um Phython
          </TitlePrincipal>
          <img src="./logo.png" />
        </Column>
        <Column>
          <Input placeholder="Digite seu Email" />
          <Input placeholder="Digite sua Palavra Passe" />
          <Button title="Login" variant="secondary" />
        </Column>
      </Container>
    </>
  );
};

export { Login };
